import React from 'react';
import DataTable from '../DataTable/DataTable'; // Assuming you have renamed the component
import scheduleDataJson from '../Schedule/scheduleData.json';
import './Schedule.css';

function Schedule() {
  return (
    <section id="schedule">
      <h1>Weekly Schedule</h1>
      <div className="schedule-container">
        <DataTable data={scheduleDataJson} />
      </div>
    </section>
  );
}

export default Schedule;
